import React, { Component } from 'react';
import antd,{Carousel} from 'antd';
import '../assets/css/Home.css'
import img from '../static/promo.png'; 
class Home extends Component {
    render() {
        return (
            <Carousel autoplay adaptiveHeight="true" centerMode="true">
                
                <div>
                
                    
                    <a href="https://freshdesignweb.com">
                        <img src={img} />
                    </a>

                   

                </div>
              
                <div>
                     <h3>2</h3>
                 </div>
                
            
            </Carousel>
        );
    }
}

export default Home;
